// src/Sidebar.js
import React from 'react';

const Sidebar = () => {
    return (
    <aside style={styles.sidebar}>
        <ul>
        <li>Home</li>
        <li>Events</li>
        <li>Settings</li>
        </ul>
    </aside>
    );
};

const styles = {
    sidebar: {
    width: '200px',
    padding: '10px',
    background: '#f0f0f0',
    },
};

export default Sidebar;
